{
	?uri rdf:type onto:Software .
      { ?uri prop:publisher 'Mean Hamster Software'@en . }
      UNION 
      { ?uri onto:publisher res:Mean_Hamster_Software . }
	OPTIONAL {?uri rdfs:label ?string . FILTER (lang(?string) = 'en') }
