SELECT DISTINCT ?uri ?string
WHERE 
{
      { ?uri rdf:type foaf:Person.        
        ?uri foaf:givenName 'Dana'@en. }
      UNION 
      { ?uri prop:alias ?alias . 
        FILTER regex(?alias,'Dana') . }
       OPTIONAL {?uri rdfs:label ?string . FILTER (lang(?string) = 'en') }       
}

